import React from 'react';
import ReportForm from './ReportForm';
import ExistedReport from './ExistedReport';

const Main = () => {
  return (
    <div>
      <div>
        <ReportForm />
      </div>
      <div>
        <ExistedReport />
      </div>
    </div>
  )
}

export default Main;
